/*eslint-disable*/

import React, { useState } from "react";
import axios from "axios";

function RestAPI() {
  const [text, setText] = useState([]);

  const getClicked = () => {
    try {
      return axios
        .get("http://127.0.0.1:8000/api/", {
          params: {
            words: "asdf",
          },
        })
        .then((response) => {
          console.log(response.data);
        });
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <>
      <h1>Rest API 연습</h1>
      <button
        onClick={() => {
          getClicked;
        }}
      >
        GET
      </button>
    </>
  );
}

export default RestAPI;
